import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useInView } from 'react-intersection-observer';
import { ParallaxProvider, ParallaxBanner } from 'react-scroll-parallax';

const Menu = () => {
    const [activeTab, setActiveTab] = useState('drinks');

    const {ref: refHome, inView: inViewHome} = useInView({
        threshold: 0.5,
        triggerOnce: true,
    });

    const { ref: refInfo, inView: inViewInfo } = useInView({
        threshold: 0.5,
        triggerOnce: true,
    });

    const { ref: refPrice, inView: inViewPrice } = useInView({
        threshold: 0.5,
        triggerOnce: true,
    });

    const { ref: refMenu, inView: inViewMenu } = useInView({
        threshold: 0.5,
        triggerOnce: true,
    });

    return (
        <div>
            <ParallaxProvider>
                <section className='slick-slider home-slider'>
                    <ParallaxBanner
                        className='slider-item'
                        layers={[
                            { image : "/assets/bg_3.jpg", speed: -30, style: { backgroundSize: "contain" }, }
                        ]}
                    >
                        <div className="overlay"></div>
                        <div className="custom-container">
                            <div className="row slider-text justify-content-center align-items-center">
                                <div ref={refHome} className={`col-md-7 col-sm-12 text-center ftco-animate ${inViewHome ? "fadeInUp ftco-animated" : ""}`}>
                                    <h1 className='mb-3 mt-5 bread'>Our Menu</h1>
                                    <p className='breadcrumbs'>
                                        <span className='mr-2'>
                                            <Link to="/">Home</Link>
                                        </span>
                                        <span>MENU</span>
                                    </p>
                                </div>
                            </div>
                        </div>
                    </ParallaxBanner>
                </section>

                <section className='ftco-menu mb-5 pb-5'>
                    <div className="custom-container">
                        <div className="row justify-content-center mb-5">
                            <div ref={refMenu} className={`col-md-7 heading-section text-center ftco-animate ${inViewMenu ? "fadeInUp ftco-animated" : ""}`}>
                                <span className='subheading'>Discover</span>
                                <h2 className='mb-4'>Our Products</h2>
                                <p>Far far away, behind the word mountains, far from the countries Vokalia and Consonantia, there live the blind texts.</p>
                            </div>
                        </div>
                        
                        <div className="row d-md-flex">
                            <div ref={refMenu} className={`col-lg-12 ftco-animate ${inViewMenu ? "fadeInUp ftco-animated" : ""}`}>
                                {/* Menu Navigation */}
                                <div className="row">
                                    <div className="col-md-12 nav-link-wrap mb-5">
                                        <div className="nav nav-pills justify-content-center" id='v-pills-tab' role='tablist'>
                                            <button 
                                                className={`nav-link ${activeTab === 'drinks' ? 'active' : ''}`}
                                                onClick={() => setActiveTab('drinks')}
                                            >
                                                Drinks
                                            </button>
                                            <button 
                                                className={`nav-link ${activeTab === 'desserts' ? 'active' : ''}`}
                                                onClick={() => setActiveTab('desserts')}
                                            >
                                                Desserts
                                            </button>
                                        </div>
                                    </div>
                                </div>

                                {/* Menu Items Grid - Ready for your database integration */}
                                <div className="row">
                                    {activeTab === 'drinks' ? (
                                        // Place for your drinks data from database
                                        <div className="col-md-6 text-center mb-5">
                                            <div className="menu-wrap">
                                                <div className="menu-img img mb-4">
                                                    {/* Your drink image */}
                                                </div>
                                                <div className="text">
                                                    <h3>{/* Drink name */}</h3>
                                                    <p>{/* Drink description */}</p>
                                                    <p className='price'><span>{/* Drink price */}</span></p>
                                                    <p><a href="#" className='btn btn-primary btn-outline-primary'>show</a></p>
                                                </div>
                                            </div>
                                        </div>
                                    ) : (
                                        // Place for your desserts data from database
                                        <div className="col-md-6 text-center mb-5">
                                            <div className="menu-wrap">
                                                <div className="menu-img img mb-4">
                                                    {/* Your dessert image */}
                                                </div>
                                                <div className="text">
                                                    <h3>{/* Dessert name */}</h3>
                                                    <p>{/* Dessert description */}</p>
                                                    <p className='price'><span>{/* Dessert price */}</span></p>
                                                    <p><a href="#" className='btn btn-primary btn-outline-primary'>show</a></p>
                                                </div>
                                            </div>
                                        </div>
                                    )}
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </ParallaxProvider>
        </div>
    );
};

export default Menu;
